  const handleViewCalendar = () => {
    // Add functionality for viewing calendar
  };

  const handleViewDocument = () => {
    // Add functionality for viewing documents
  };

  const handleViewTask = () => {
    // Add functionality for viewing tasks
  };

  return (
    <div>
      <Header />
      <div className="container">
        <div className="sidebar">
          <div className="sidebar-icon" onClick={handleEmployeeList}><FaUsers size={30} /></div>
          <div className="sidebar-icon" onClick={handleViewProfile}><FaUser size={30} /></div>
          <div className="sidebar-icon" onClick={handleViewMessage}><FaEnvelope size={30} /></div>
          <div className="sidebar-icon" onClick={handleViewCalendar}><FaCalendarAlt size={30} /></div>
          <div className="sidebar-icon" onClick={handleViewDocument}><FaFileAlt size={30} /></div>
          <div className="sidebar-icon" onClick={handleViewTask}><FaTasks size={30} /></div>
        </div>
        <div className="main-content">
          {/* Add news container */}
          <div className="news-container">
            <h2>Dernières nouvelles</h2>
            <p>Lorem ipsum </p>
          </div>
          {/* Add tasks container */}
          <div className="tasks-container">
            <h2>Tâches en cours</h2>
            {/* Add your tasks content here */}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
